import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Redirect, NavLink } from 'react-router-dom';

const links = ['Input', 'Task List'];
function App() {
  return (
    <HashRouter>
      <header />
      <nav>
        <div>
          {links.map((link) => (
            <NavLink className="headerLink" key={link} to={link}>
              {link}
            </NavLink>
          ))}
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route exact path="/input" component={Rooms} />
          <Route exact path="/list" component={Bookings} />
          <Route exact path="/visitors" component={Visitors} />
          <Route render={() => <Redirect to="/Rooms" />} />
        </Switch>
      </div>
    </HashRouter>
  );
}

export default App;
